import axios from "axios";

export default class ArchivePage extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            archives:"",
        };
    }

    componentDidMount() {
        axios("/listarchives").then(({ data }) => {
            this.setState({
                archives: data
            });
        });
    }


